import React from 'react';


const Card = ({ img, name, num, id}) => {
    return (
        <div className='tc bg-white dib br3 pa3 ma2 grow bw2 shadow-5 card'>
            <img src={`${img}`} alt={`pokemon${idd}`}/>
            <div>
                <h2>{name}</h2>
                <p>{num}</p>
            </div>
        </div>
    )
}

export default Card
